import React from "react";
import { NavLink } from 'react-router-dom'
import '../assets/jumboClarke.css'

const JumboClarke = () => {
    return (
        <div>
            <div className="backgroundImage"></div>
            <div className="jumboClarke">
                <h1>Residence Halls</h1>
            </div> 
        </div>
    )
}

export default JumboClarke
